MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Simcenter Flotherm software is a thermal modeling analysis tool designed to simulate the airflow and heat transfer in electronic systems, subsystems, and packages. Using Simcenter Flotherm shortens design cycles and yields better, more reliable products, being  correct by design .");
MGCAddSnippet(5, "Simcenter Flotherm uses Computational Fluid Dynamics (CFD) to analyze airflow and heat transfer and is specifically designed to investigate these phenomena within electronics equipment. ");
MGCAddSnippet(6, "A high-level overview of the process.");
MGCAddSnippet(7, "You define the overall dimensions of the volume or enclosure to be investigated, including the individual components that make up the design structure, and superimpose the computational grid.");
MGCAddSnippet(8, "During program solution, Simcenter Flotherm integrates the relevant differential conservation equations over each computational grid cell, assembling a set of algebraic equations which relate the value of a variable in a cell to its value in its nearest neighbor.");
MGCAddSnippet(9, "The program solves the algebraic equations, using iterative procedures to converge on a solution after a finite number of successive iterations.");
MGCAddSnippet(10, "After solution, the circulation patterns in the form of velocity vectors, isotherm, and isobar contours and fills, may be displayed to show the resultant flow behavior.");
MGCAddSnippet(11, "Simcenter Flotherm is a multi-application product, comprising the Project Manager, Command Center, MCAD Bridge, and EDA Bridge.");
MGCAddSnippet(12, "The first step when creating a project in Simcenter Flotherm is to define the requirements. You need to determine what is to be achieved and identify the key features to be modeled.");
MGCAddSnippet(13, "Take the time to assess exactly what to model before starting.");
MGCAddSnippet(14, "It is recommended that you start with a simple model and add complexity in stages.");
MGCAddSnippet(15, "Important aspects of your model to consider before and during modeling.");
MGCAddSnippet(16, "General information, such as how to run the product in interactive and batch modes, project operations such as loading, importing, and exporting projects and descriptions of general dialog boxes. Descriptions of elements of the Project Manager window, and data tree operations.");
MGCAddSnippet(17, "Each study is encapsulated within a unique Simcenter Flotherm project.");
MGCAddSnippet(18, "Simcenter Flotherm can started from the GUI or from a command line. ");
MGCAddSnippet(19, "Running interactively enables setup, flow calculation, and results analysis to be completed in the same program session.");
MGCAddSnippet(20, "You can start the product with a specified project from the command window.");
MGCAddSnippet(21, "Exiting is straightforward if the solver is not running and the currently open project is saved.");
MGCAddSnippet(22, "You can use XML files as script files to run a sequence of Simcenter Flotherm operations.");
MGCAddSnippet(23, "Successful usage of FloSCRIPT relies on familiarity and experience with the Simcenter Flotherm implementation of scripting XML.");
MGCAddSnippet(24, "FloSCRIPT files are XML script files that can record a sequence of user operations.");
MGCAddSnippet(25, "FloSCRIPT files are XML script files that can run a sequence of operations.");
MGCAddSnippet(26, "Use the Project Manager to control and build your projects. You can create new projects or load existing ones as well as display and manipulate the project geometry data using a tree hierarchy. The Project Manager opens when Simcenter Flotherm starts and it is active for the entire program session.");
MGCAddSnippet(27, "The Project Manager window is displayed after the splash screen closes.");
MGCAddSnippet(28, "Property sheets are the standard user interface for specifying values and parameters.");
MGCAddSnippet(29, "Simcenter Flotherm uses assemblies and parts to organize its geometry data. These assemblies and parts are displayed in a data tree, under the Model tab, which can be expanded or contracted (Reset) to show or hide the hierarchical structure of the project geometry.");
MGCAddSnippet(30, "Use the palette to add objects to the data tree and drawing board.");
MGCAddSnippet(31, "The Project Attributes/Library trees are on the right of the drawing board. The quickest way to display or hide these trees is to press F7. Each tree is displayed in a separate tab.");
MGCAddSnippet(32, "Use the status bar to see summary information about the currently loaded project.");
MGCAddSnippet(33, "Use the workplane to manipulate the geometry and display a solution or snap grid.");
MGCAddSnippet(34, "A grid of positions to which geometry can be restricted.");
MGCAddSnippet(35, "The following are operations carried out on the project as an entity, rather than modeling operations within an opened project.");
MGCAddSnippet(36, "You can create an empty project or a model project from a template.");
MGCAddSnippet(37, "The default project is the project that opens when you start Simcenter Flotherm.");
MGCAddSnippet(38, "Support Center contains application examples, which demonstrate Simcenter Flotherm modeling techniques. You can install these in your version of Simcenter Flotherm for reference or to use as the basis of your own models.");
MGCAddSnippet(39, "Projects can be loaded (that is, opened) as described in the following subsections.");
MGCAddSnippet(40, "You may need to update or just view the geometry and results generated in a previous project or program session. To access the information generated, you must load the project into program memory.");
MGCAddSnippet(41, "Before you can load a project that is owned by someone else, you must become the owner of the project.");
MGCAddSnippet(42, "The initial default setting of the Solution Directory is set up during the installation procedure.");
MGCAddSnippet(43, "Catalog if there are projects copied or moved into the directory using the OS, but they are not listed in the Load Project dialog box.");
MGCAddSnippet(44, "Importing FloXML, PDML, and PACK files.");
MGCAddSnippet(45, "Project FloXML files are XML files that can be imported into Simcenter Flotherm as projects.");
MGCAddSnippet(46, "PDML files provide a simple method of transferring a project from one Simcenter Flotherm installation to another.");
MGCAddSnippet(47, "PACK files include the project and any solution results.");
MGCAddSnippet(48, "Version 1.4 files require a non-standard import treatment.");
MGCAddSnippet(49, "Versions 2 and 3 files require a non-standard import treatment.");
MGCAddSnippet(50, "Once projects created in previous versions of Simcenter Flotherm have been loaded and saved, they can no longer be run on the earlier version of Simcenter Flotherm. ");
MGCAddSnippet(51, "GDA images can be captured to JPEG or PNG files.");
MGCAddSnippet(52, "The Save Project dialog box is opened when you save a project for the first time.");
MGCAddSnippet(53, "Template projects can be used when creating new projects.");
MGCAddSnippet(54, "Projects can be can be exported to external disk files.");
MGCAddSnippet(55, "You can export a thermal network representation in SPICE-Eldo or VHDL-AMS format, or a set of files for a BCI-ROM analysis of the model.");
MGCAddSnippet(56, "You can archive a project in PDML or PACK formats. PACK files can include or exclude results.");
MGCAddSnippet(57, "Export the solution directory in PDML format files if you do not need to save the results. You can automate the procedure by creating scripts.");
MGCAddSnippet(58, "Export in PACK file format if you need the project and the results. PACK file format is the recommended format to use when sending projects to Mentor Graphics Mechanical Analysis customer support. You can automate the procedure by creating scripts.");
MGCAddSnippet(59, "Deleting a project removes the project completely.");
MGCAddSnippet(60, "Configuring the user interface, and setting user preferences.");
MGCAddSnippet(61, "Visibility of the toolbars is controlled by a pop-up dialog box comprising a set of check boxes.");
MGCAddSnippet(62, "The drawing board can be detached from the Project Manager window to create a separate Drawing Board window. This is particularly effective when using multiple screens.");
MGCAddSnippet(63, "The Profiles window is detached from the Project Manager window by default.");
MGCAddSnippet(64, "Global units are used throughout Simcenter Flotherm as default units in property sheets and dialog boxes. All property sheets and dialog boxes use the default global units when first shown. If you change a global unit then the property sheets and dialog boxes will use that unit the next time they are opened.");
MGCAddSnippet(65, "For convenience you may want to input data in non-default units. For example, the global setting for Length Unit defaults to meters, but you may want to enter values from a manufacturer s specification which is in inches.");
MGCAddSnippet(66, "Multiple undo and redo is possible within the following limitations.");
MGCAddSnippet(67, "You have a choice between using absolute or local coordinates.");
MGCAddSnippet(68, "To speed up the solving process, provided you have multiple processors, you can specify more than one processor when running the solver.");
MGCAddSnippet(69, "Objects in the data tree are manipulated by functionality provided by the project manager.");
MGCAddSnippet(70, "Summary information provides a quick way of viewing power source values, object sizes, and attached attributes in table format.");
MGCAddSnippet(71, "Simcenter Flotherm uses the concept of assemblies and parts to create the geometry. The top-level root assembly contains all the project geometry, but to create a structured design you create sub-assemblies of related functional parts, for example separate assemblies for the structure, equipment, and ventilation.");
MGCAddSnippet(72, "New data tree objects are created as children of the item selected in the data tree.");
MGCAddSnippet(73, "Parts can be colocated in an assembly.");
MGCAddSnippet(74, "Individual multiple selection and contiguous multiple selection are supported.");
MGCAddSnippet(75, "The listing order of the geometry reflects the setup sequence.");
MGCAddSnippet(76, "When viewing long data trees, you can restrict ( top ) the tree view to show only an assembly or part. By Topping assemblies you can methodically step through all the assemblies in a particular path from the highest to the lowest level in the data tree. Topping is also reflected in the drawing board and so can be used to declutter views.");
MGCAddSnippet(77, "Improving the readability of a data tree by hiding all child objects of an assembly.");
MGCAddSnippet(78, "Simple searches, based on a name, can be used to find objects in the data tree, or attributes in the Project Attributes tree.");
MGCAddSnippet(79, "Complex combinations of criteria can be specified to find objects in the data tree, or attributes in the Project Attributes tree.");
MGCAddSnippet(80, "The same property sheet field change can be made to selected objects.");
MGCAddSnippet(81, "You can append unique sequence numbers to non-unique names to aid the identification of objects.");
MGCAddSnippet(82, "Zoom-in projects are projects created from volume regions, and can be used to concentrate the computer analysis on a particular area of interest. Zoom-in projects can be useful if changes over the region will have little effect on the global flow fields of the original solution domain.");
MGCAddSnippet(83, "Zooming in on a cabinet in a data center. ");
MGCAddSnippet(84, "Create a zoom-in project when you want to zoom-in and refine the geometry and modeling complexity over a particular region without incurring the computational overhead of solving the complete project.");
MGCAddSnippet(85, "The coupling metric, or the measure of the amount a zoom-in region changes the results, can be obtained using the project notes.");
MGCAddSnippet(86, "The following dialog boxes are associated with general project operations.");
MGCAddSnippet(87, "Use this dialog box to continue using the current project or create a new project.");
MGCAddSnippet(88, "Use this dialog box to specify the format of the BCI-ROM files that you are exporting, request an acceptable relative error value, and to set a global HTC range.");
MGCAddSnippet(89, "Use this dialog box to create a new template category. ");
MGCAddSnippet(90, "Use this dialog box to perform a quick or detailed search for objects in the current topped assembly.");
MGCAddSnippet(91, "Use this tab to perform a quick search for objects in the current topped assembly.");
MGCAddSnippet(92, "Use this dialog box to search the current topped assembly for objects whose properties match all or at least one of a list of user-defined search criteria.");
MGCAddSnippet(93, "Use this dialog box to set the default units used throughout the system, for example, as shown in SmartPart property sheets.");
MGCAddSnippet(94, "Use this dialog box to reacquire the connection to the license server or exit Simcenter Flotherm.");
MGCAddSnippet(95, "Use this dialog box to load a previously saved project, to delete a project, to unlock a project or to catalog a Solution Directory. ");
MGCAddSnippet(96, "This window reports general errors, warnings, and information.");
MGCAddSnippet(97, "Use this dialog box to create a new project from an existing template. You can also set the default template which is loaded when you start Simcenter Flotherm.");
MGCAddSnippet(98, "Use this dialog box to read any reference notes attached to the current project. ");
MGCAddSnippet(99, "Use this dialog box to save a project with the name you specify. The results, if any, are also saved.");
MGCAddSnippet(100, "Use this dialog box to request an acceptable relative error value.");
MGCAddSnippet(101, "This dialog box shows solver progress data during an export, and closes when the export of data has completed.");
MGCAddSnippet(102, "Use this dialog box to set your preferences. The dialog box has four tabs.");
MGCAddSnippet(103, "Use this tab to set preferences for coordinates, number of processors to use, and project manager behavior.");
MGCAddSnippet(104, "Use this tab to control the display of the snap grid, monitor points, regions, flow/source direction, gravity, solar vectors, and background color of the GDA. The settings are retained when Simcenter Flotherm closes.");
MGCAddSnippet(105, "Use this tab to control the displayed summary information. The settings are retained when Simcenter Flotherm closes.");
MGCAddSnippet(106, "Use this tab to specify the resolution of GDA snapshots, change font sizes when the GDA is in Analyze mode, and change the rendering of animations.");
MGCAddSnippet(107, "Use this dialog box to create and name a zoom-in project. The dialog box also displays the number of cells on the region boundary.");
MGCAddSnippet(108, "Simcenter Flotherm requires defining a region of space (solution domain) within which mathematical model equations are to be solved. Modeling the solution domain requires the setting of the solution domain dimensions, boundary conditions, and the filling fluid properties.");
MGCAddSnippet(109, "The solution procedures are based on CFD techniques.");
MGCAddSnippet(110, "Simcenter Flotherm provides solution for the parts of the model contained within the solution domain. You can edit the solution domain to meet the scope of your model.");
MGCAddSnippet(111, "Defining the solution domain size, location, boundaries, external ambient conditions and reference temperatures and pressure.");
MGCAddSnippet(112, "Moving or changing the size of the solution domain in the drawing board can be faster and more intuitive than entering values in the System property sheet.");
MGCAddSnippet(113, "By default, the six boundaries of the solution domain are treated as open boundaries.");
MGCAddSnippet(114, "For non-cuboid models, you can create cutouts to remove sections of the solution domain.");
MGCAddSnippet(115, "How symmetry can be used to simplify a model.");
MGCAddSnippet(116, "For radiation, symmetry means that every object within the domain has a mirror image on the other side of the symmetry face.");
MGCAddSnippet(117, "The following topics discuss the initial field values of the model.");
MGCAddSnippet(118, "For steady state, the initial field values will not affect the final converged results, but a good initial guess will reduce the time taken to reach a solution convergence. However, for the majority of cases, the defaults are normally sufficient.");
MGCAddSnippet(119, "Solution variables are calculated during the solution.");
MGCAddSnippet(120, "You can start a solution using initial variable values obtained from a previously solved project (solution set).");
MGCAddSnippet(121, "How to check the initial values of variables before a solution is started.");
MGCAddSnippet(122, "You can initialize variables over sub-regions of the solution domain, within the solution domain and specify initial values of variables within those subdomains.");
MGCAddSnippet(123, "The following topics describe types of solution variables, and how to obtain them.");
MGCAddSnippet(124, "Simcenter Flotherm calculates the base variables (temperature, pressure, and velocities) during solution depending on the type of model chosen.");
MGCAddSnippet(125, "After solution, auxiliary variables can be calculated from the base and derived variables.");
MGCAddSnippet(126, "The following procedures relate to the solution variables.");
MGCAddSnippet(127, "The base solution variables are the variables that are automatically selected for calculation, and are dependent on the type of solution you choose.");
MGCAddSnippet(128, "In addition to the automatically-selected base variables, you can select additional variables to be calculated.");
MGCAddSnippet(129, "The following selections are made using the Model Setup tab.");
MGCAddSnippet(130, "Overviews of Flow and Heat Transfer, Flow Only and Conduction Only.");
MGCAddSnippet(131, "Mass Flux values are not normally stored, but can be if the Store Mass Flux check box in the Model Setup tab is checked.");
MGCAddSnippet(132, "Heat Flux values are not normally stored, but can be if the Store Heat Flux check box in the Model Setup tab is checked.");
MGCAddSnippet(133, "Calculation of surface temperature values.");
MGCAddSnippet(134, "Temperature gradient values are not normally stored, but can be if the GradT check box in the Stored Variables section of Model Setup tab is checked.");
MGCAddSnippet(135, "Power Density values are not normally stored, but they can be if the Power Density check box in the Stored Variables section of the Model Setup tab is checked.");
MGCAddSnippet(136, "Normalized parameters that give an indication of thermal bottlenecks and paths.");
MGCAddSnippet(137, "The choice of dimensionality is one of the most important decisions you have to make when performing a CFD calculation.");
MGCAddSnippet(138, "The Capture Index (CI) can be used to assess the cooling performance in data centers involving discrete models of racks and cooling devices.");
MGCAddSnippet(139, "There are two types of CI (Cold Aisle and Hot Aisle) that can be defined for assessing cooling performance in data centers.");
MGCAddSnippet(140, "Aisles are identified by attaching group or sub-group names to flow device objects.");
MGCAddSnippet(141, "Calculations of capture index for cold and hot aisle groups. ");
MGCAddSnippet(142, "In general, a CI value of 100% for all racks will guarantee good cooling performance, however, this is very difficult, and often unnecessary, to achieve.");
MGCAddSnippet(143, "The calculation of CI is switched on using a Model Setup tab check box, and the objects to be involved in the analysis must be identified by attachment to hot or cold aisle groups or sub-groups.");
MGCAddSnippet(144, "Names for aisle groups and sub-groups are user-defined.");
MGCAddSnippet(145, "Aisle Group attachments can be seen in the summary information table provided they have been switched on for display.");
MGCAddSnippet(146, "On completion of the Simcenter Flotherm solution, a post-processing calculation is automatically started which outputs results that can be displayed in tabular format when in Analyze mode.");
MGCAddSnippet(147, "CI output is fully supported in the Command Center, with access to the CI values in the Output Variables panel and subsequent output in the Scenario Table.");
MGCAddSnippet(148, "By default, Simcenter Flotherm does not model the effects of the Sun.");
MGCAddSnippet(149, "Solar radiation is affected when passing through transparent materials and resistances and perforated plates.");
MGCAddSnippet(150, "The effects of the Sun on the model can be included in the solution.");
MGCAddSnippet(151, "The flow type can be Laminar or Turbulent.");
MGCAddSnippet(152, "In laminar flow, the mixing between fluid elements takes place at the microscopic level by molecular diffusion, and is, therefore, controlled by the physical properties of the fluid, namely the laminar (that is, molecular) viscosity for the diffusion of momentum and the conductivity of heat. ");
MGCAddSnippet(153, "Turbulent flow is an irregular, fluctuating, and chaotic motion, which in Simcenter Flotherm is treated as being superimposed on the underlying mean motion.");
MGCAddSnippet(154, "A significant turbulence contributor comes from airflow over solid surfaces. The Revised Algebraic model calculates the turbulent viscosity to account for this.");
MGCAddSnippet(155, "The Automatic Algebraic model is identical to the Revised Algebraic, except the calculated turbulent viscosity field is not capped.");
MGCAddSnippet(156, "The KE model is blended when calculating the effect of turbulence near to a wall.");
MGCAddSnippet(157, "Gravity gives rise to natural convection within enclosures whenever temperature differences are present.");
MGCAddSnippet(158, "Specifying direction.");
MGCAddSnippet(159, "How gravity on fluids is treated.");
MGCAddSnippet(160, "To accurately model the cooling/heating effect by the surrounding air, you must define its density, conductivity, specific heat, viscosity, and expansivity.");
MGCAddSnippet(161, "The model reference temperature and pressure are set in the Model Setup tab.");
MGCAddSnippet(162, "The pressure relative to the datum pressure is referred to as the gauge pressure.");
MGCAddSnippet(163, "The heat loss/gain through radiative transfer is achieved by setting the remote source temperature in the Model Setup tab and then applying an emissivity value to the exterior surface using a Surface attribute.");
MGCAddSnippet(164, "The ambient temperature is used in the definition of the buoyancy force resulting from temperature differences within the enclosure.");
MGCAddSnippet(165, "The ambient temperature is used as the default initial value for the temperature field.");
MGCAddSnippet(166, "Independently varying ambient air temperature and radiant temperature.");
MGCAddSnippet(167, "Joule heating can be modeled by creating Source SmartParts within electrically conducting geometry, or by importing power map CSV files to create Power Map SmartParts.");
MGCAddSnippet(168, "Electrical potential and current can be defined at conductive solids to model the thermal effects of Joule heating.");
MGCAddSnippet(169, "Power maps of PCB nets, exported as CSV files from HyperLynx PI, can be imported into Simcenter Flotherm to predict the temperatures of (high) current carrying copper nets in PCBs (that is, to predict the effect of Joule heating).");
MGCAddSnippet(170, "GUI interfaces associated with the solution domain and the solution.");
MGCAddSnippet(171, "Use this property sheet to set the location and size of the solution domain. The solution domain defines the extent of the geometry model included in the Simcenter Flotherm calculations, for example, either the complete model or just a subset of it.");
MGCAddSnippet(172, "Use this property sheet to define all or individual (six) faces of the solution domain and their ambient attribute(s).");
MGCAddSnippet(173, "Use this property sheet to define a subregion in the solution domain over which constant initial values can be applied.");
MGCAddSnippet(174, "Use this property sheet tab to set a constant subdomain value for each of the variables listed. The variables listed depend on the Type of Solution, Turbulence Model and if the fluid density is set to follow the Ideal Gas Law.");
MGCAddSnippet(175, "Use this dialog box to model the effects of short-wave radiation from the sun.");
MGCAddSnippet(176, "Use this tab to define the principal features of the mathematical model.");
MGCAddSnippet(177, "Use this section of the Model Setup tab to activate or deactivate the effects of gravity. When activated, gravity can be simulated as a force acting on the fluid either parallel or angled to any of the coordinate directions.");
MGCAddSnippet(178, "Use this section of the Model Setup tab to define the airflow model.");
MGCAddSnippet(179, "Use this section of the Model Setup tab to set the basic reference values that are used throughout the solution domain.");
MGCAddSnippet(180, "Use this section of the Model Setup tab to calculate and store additional data during a solve. By default, only Surface Temperatures is selected (Yes) to be calculated.");
MGCAddSnippet(181, "Use this section of the Model Setup tab to calculate auxiliary variables after a solve.");
MGCAddSnippet(182, "Use this tab to control the solution.");
MGCAddSnippet(183, "Use this section of the Solver Control tab to use Monitor Points to control the steady-state or transient solution.");
MGCAddSnippet(184, "Use this section of the Solver Control tab to control the solution of a field variable.");
MGCAddSnippet(185, "Use this dialog box to load solution data from a selected project.");
MGCAddSnippet(186, "Use this dialog box when changing the solution type from steady-state to transient, or vice versa, to continue using the same project or save as a new project.");
MGCAddSnippet(187, "You can create and manipulate the model geometry using the project data tree and the drawing board. Simcenter Flotherm uses a rectangular coordinate method for modeling, and all geometry is constructed from fundamental cuboid and prism shapes.");
MGCAddSnippet(188, "The geometry is built by locating and defining the geometry using primitives, assemblies, and SmartParts. In addition, you can import models of current carrying conductors as Power Maps to use to predict the effect of Joule heating.");
MGCAddSnippet(189, "Geometry is defined by two coordinate systems: Local Object Coordinates and System Coordinates.");
MGCAddSnippet(190, "Construction precedence is significant when objects of the same type coincide.");
MGCAddSnippet(191, "Objects at the bottom of data tree are considered to have been created last and, in general, take precedence.");
MGCAddSnippet(192, "SmartParts are provided for the construction of common complex shapes, however, unusual shapes can be built up by the insertion of multiple overlapping cuboids, triangles, and collapsed cuboids. Heat transfer in complex shapes constructed in this way are subject to rules.");
MGCAddSnippet(193, "To explain how heat transfer is treated by the program when two bodies are in contact, we will look at two example cases.");
MGCAddSnippet(194, "To explain how heat transfer is treated by the program when two bodies overlap, we will look at two example cases.");
MGCAddSnippet(195, "The heat transfer depends on the thermal model defined for the thermal attribute attached to the block.");
MGCAddSnippet(196, "Heat transfer for the case of a block with a penetrating collapsed cuboid.");
MGCAddSnippet(197, "Heat transfer in the case of an intersection of a thin (collapsed) sloping block with a cuboid block.");
MGCAddSnippet(198, "Heat transfer where conductive cuboids are in contact with the domain edge or cutout is specified by attaching an ambient attribute.");
MGCAddSnippet(199, "The positions of SmartParts in the model are subject to context rules.");
MGCAddSnippet(200, "Additional context rules are required to ensure that some flow objects are included in the solution.");
MGCAddSnippet(201, "If two or more fixed flows overlap, their volume flow rates are additive, and, by default, the cumulative flow is averaged across the cross-sectional area of the overlapping apertures.");
MGCAddSnippet(202, "The context rules are dependent on whether the overlaps are from the same or from different recirculation devices.");
MGCAddSnippet(203, "When two or more sources overlap, the effect of each source is added together to provide the total source.");
MGCAddSnippet(204, "Overlapping discrete solid components are treated in the same way as blocks and prisms.");
MGCAddSnippet(205, "The network cuboids exhibit the normal order of precedence rules within the network assembly or heat pipe, that is, cuboids lower down the tree will overwrite those above.");
MGCAddSnippet(206, "When Activate Plate Conduction is checked on in the Solver Control tab, all collapsed cuboids are treated as uncollapsed objects.");
MGCAddSnippet(207, "Simcenter Flotherm can import and export geometry in different file formats.");
MGCAddSnippet(208, "PDML (Physical Design Modeling Language) files are used to transfer information to and from the external file system for either the complete project or any selected assembly in the data tree.");
MGCAddSnippet(209, "FloXML files are XML files that can be imported into Simcenter Flotherm.");
MGCAddSnippet(210, "Simcenter Flotherm can export FloFEA (Finite Element Assembly) files.");
MGCAddSnippet(211, "You can import ECAD geometry from IDF board description files or using one of the supplied direct interfaces.");
MGCAddSnippet(212, "You can import and export assemblies and projects to and from Simcenter Flotherm in Electronics Cooling XML (ECXML) open neutral file format.");
MGCAddSnippet(213, "Simcenter Flotherm Network Assembly SmartParts can be imported from, and exported to, JEDEC Part Model xml files. Only the ThermalSection of the xml file is read and written by the Simcenter Flotherm import and export processes.");
MGCAddSnippet(214, "You can import a number of MCAD geometry file formats via MCAD Bridge.");
MGCAddSnippet(215, "Direct Interfaces are available to Cadence Allegro PCB Designer, Cadence Allegro Package Designer, Mentor Graphics Board Station, Mentor Graphics Expedition Enterprise Flow and Zuken CR5000 Board Designer.");
MGCAddSnippet(216, "Simcenter Flotherm can import Joule Heating power values as predicted by HyperLynx PI,");
MGCAddSnippet(217, "The following operations are associated with creating the geometry of a model.");
