MGCAddSnippet(301, "Grid operations on the drawing board, where the grid can be optimized prior to solving.");
MGCAddSnippet(302, "The spatial solution grid subdivides the solution domain into a set of non-overlapping contiguous finite volumes called grid cells.");
MGCAddSnippet(303, "User control over the dimensions of the spatial solution grid.");
MGCAddSnippet(304, "It is useful to know the order in which the grid is calculated to appreciate how modifications affect the final grid.");
MGCAddSnippet(305, "Use the Grid Summary dialog to check that the grid is suitable for the current application.");
MGCAddSnippet(306, "It is important to ensure adequate grid coverage wherever objects are placed in the model. Grid constraints define the minimum grid requirement across a selected geometry.");
MGCAddSnippet(307, "By default, grid lines generated by an object, whether they are due to keypoints or constraint lines, extend to the edges of the solution domain, however, this may not be necessary and can be prevented by  localizing  the grid.");
MGCAddSnippet(308, "Localizing a grid can be an effective way of reducing the number of cells.");
MGCAddSnippet(309, "To allow the nesting of localized grid spaces, a parent-child grid relationship is followed.");
MGCAddSnippet(310, "Where localized grid spaces abut, all of the grid lines from one grid space pass through (or bleed into) the other. ");
MGCAddSnippet(311, "The extent of a localized grid space is determined by the keypoints on the corners of the object or inflation box.");
MGCAddSnippet(312, "Localization can be applied to inflated grids to restrict the grid lines to the object space and inflated area.");
MGCAddSnippet(313, "When localized grid spaces overlap, the smallest grid cell specification is used to define the overlapped space.");
MGCAddSnippet(314, "If a localized grid space is one grid cell away from the edge of the solution domain, then an additional grid line is inserted to ensure there are two grid cells.");
MGCAddSnippet(315, "When objects are placed inside a localized grid, the grid is modified.");
MGCAddSnippet(316, "Care must be taken when placing certain objects near localized grids.");
MGCAddSnippet(317, "When smoothing the grid spacing across the solution domain, the existence of small localized grid cells may cause the addition of grid cells in the parent grid.");
MGCAddSnippet(318, "The minimum cell size in the base grid is determined by the system grid setting. Localized grid spaces can reduce (but not increase) their minimum allowable cell size via the grid constraint attached to the localized object which defines the space.");
MGCAddSnippet(319, "When localizing grid space, the localized grid space is the same size as the object. However, the grid space can be extended beyond an object by specifying an inflation layer.");
MGCAddSnippet(320, "After all other grid conditions have been applied, you can smooth the grid by removing large variations in neighboring cell size in each direction, and removing large aspect ratios between directions.");
MGCAddSnippet(321, "Keypoint deactivation occurs when objects are close together to reduce an excessive number of grid cells.");
MGCAddSnippet(322, "The following procedures can be used to control the solution grid.");
MGCAddSnippet(323, "Use the following procedure to  debug  large aspect ratio grid cells.");
MGCAddSnippet(324, "How to change the grid constraints that apply to the whole system.");
MGCAddSnippet(325, "Grid constraints are applied to individual objects, assemblies, and cutouts on the solution domain by attaching Grid Constraint attributes.");
MGCAddSnippet(326, "Localize the grid around an object to stop grid lines from extending unnecessarily far from the object.");
MGCAddSnippet(327, "Inflate the grid around an object to extend the grid in the vicinity of the object.");
MGCAddSnippet(328, "Deflate the grid around an object to remove the effect of grid inflation.");
MGCAddSnippet(329, "Smoothing the grid should be the last stage of defining your grid. ");
