MGCAddSnippet(331, "Use this property sheet to refine the solution grid by setting a predefined standard grid type (coarse, medium, or fine) or manually changing the grid by successive degrees of grid density.");
MGCAddSnippet(332, "Use this dialog to check the grid statistics for the base solution domain grid or a localized grid.");
MGCAddSnippet(333, "Results may be interpolated because of a change in the grid. Use this dialog box to continue using the current project or create a new project.");
MGCAddSnippet(334, "Results may be interpolated because of a change in the grid. Use this dialog box to continue using the current project, which will no longer be backward compatible, or create a new project.");
MGCAddSnippet(335, "Use a transient analysis for cases where the alteration of flow and heat transfer with time is of interest (for example, for such events as a power up).");
MGCAddSnippet(336, "In transient simulations, the settings of the initial conditions are part of the problem specification, since earlier-time values influence later-time values. This is not the case for steady state simulations, where the initial conditions only affect the speed at which the solution converges. The use of Monitor Points is fundamental to transient analyses, because Monitor Points enable you to observe how variables change over time.");
MGCAddSnippet(337, "The Total Transient Time is the total time over which you want to perform a transient analysis. The Solution Period is the period over which the solver runs. To examine 3D results at intervals over the total transient time, specify a solution period that is shorter than the total transient time.");
MGCAddSnippet(338, "Monitor Point variable values are calculated at the end of each Time Step.");
MGCAddSnippet(339, "For maximum accuracy, convergence must be achieved for each time step. Solution errors remaining from incomplete convergences are propagated (and possibly enlarged) from one time step to the next.");
MGCAddSnippet(340, "As you use the transient analysis tool you will gain experience on how to tailor the time steps to get a good resolution without excessive computational time.");
MGCAddSnippet(341, "By default, there is one time step which corresponds to the entire solution period. Time Steps are added by adding Time Patches. A Time Patch is made up of one or more Time Steps.");
MGCAddSnippet(342, "There are four possible distribution profiles of time steps within a time patch. These profiles enable you to vary the length of a time step. Often small time steps are required near the start of the transient and longer time steps towards the end of the transient, for example, in a heat-up or cool-down scenario where the greatest change in temperature will most-likely occur at the beginning of the time period, the Increasing Power distribution type is ideal for this.");
MGCAddSnippet(343, "Transient keypoints locate the solution time steps. By default, there is one time step, with a keypoint at the start and at end of the solution period.");
MGCAddSnippet(344, "You can set time-varying Thermal, Source, or Ambient attributes by attaching a Transient attribute that modifies the host attribute by a multiplication factor.");
MGCAddSnippet(345, "3D field data of transient analyses can be recorded at times other than the end of solution and will then be available for post-processing in Analyze mode.");
MGCAddSnippet(346, "Setting up, solving, and viewing results of a transient analysis.");
MGCAddSnippet(347, "It is advisable to run a steady-state analysis before running a transient analysis to obtain a good level of convergence. Errors can accumulate over a transient solution, and a non-convergent case will take significantly longer to solve when run in transient mode. ");
MGCAddSnippet(348, "The transient analysis grid is a balance between accuracy and computational time.");
MGCAddSnippet(349, "Time steps are created by adding and defining time patches. A time patch is made up of one or more time steps.");
MGCAddSnippet(350, "When setting up a transient solution, you can optionally decide to save 3D data at specific times (Save Times) during the transient solver run.");
MGCAddSnippet(351, "When have set up the time step distribution, you can start a transient analysis. In practice you may need to repeat the analysis, adjusting the transient grid to obtain improving results.");
