MGCAddSnippet(406, "The Simcenter Flotherm solution activates the CFD algorithms which provide an integration of the fluid flow and heat transfer equations within the solution domain.");
MGCAddSnippet(407, "The termination residuals can be set to be automatically calculated by the program.");
MGCAddSnippet(408, "When the solution process is initiated, the most-likely scenario is that the solution will converge, however, there are other possibilities.");
MGCAddSnippet(409, "If your solution fails to converge or converges extremely slowly, then you can reset the solution control panels.");
MGCAddSnippet(410, "There are various advanced techniques, both automatic and manual, which can be used to optimize the solution process. In discussing their use, it is important to know that it is only possible to give general guidelines rather than hard and fast rules on how they should be altered for particular situations.");
MGCAddSnippet(411, "False time step under-relaxation is the principal means that you will use to control convergence of the iterative algorithm.");
MGCAddSnippet(412, "The Multi Grid option is designed to choose an iteration procedure which uses multi grid acceleration to solve the linear equations for temperature.");
MGCAddSnippet(413, "Inner iterations solve the equations for temperature, velocities, and pressure at each outer iteration (or solution pass).");
MGCAddSnippet(414, "Fan Relaxation is used specifically to control the variation in the flow calculated at fans for each outer iteration.");
MGCAddSnippet(415, "For all solutions, monitor points can be used to determine whether the solved variables have reached a steady state. However, they are particularly useful for determining convergence in the low-level stable and low-level oscillation profiles.");
MGCAddSnippet(416, "In situations where the convergence is of the low-level stable or low-level oscillation type, it can be useful to examine the error field for particular variables.");
MGCAddSnippet(417, "You can choose not to use the program-calculated values and set your own values for the termination residuals.");
MGCAddSnippet(418, "If the residual errors flatten off at an unacceptably high level (for example, greater than 100), stop the solution, activate the double-precision solver, then continue the solution.");
