MGCAddSnippet(467, "Use this tab to change the appearance and content of the selected annotation. The options available depend on the type of annotation: Geometry, Plot, or Scalar.");
MGCAddSnippet(468, "Use this tab to change the anchor point and position of the selected annotation.");
MGCAddSnippet(469, "Use this property sheet to activate and scope a plot animation.");
MGCAddSnippet(470, "Use this property sheet to open, rename, or redefine a saved tables. A saved tables is a set of one or more results tables associated with one or more data tree objects.");
MGCAddSnippet(471, "Use this property sheet to view the position and orientation of a viewpoint, and to jump to a viewpoint.");
MGCAddSnippet(472, "Tables of results, displayed when the Project Manager is in Analyze mode.");
MGCAddSnippet(473, "The types of results tables available in Analyze mode after solving.");
MGCAddSnippet(474, "Cases where cuboids are in contact with cuboids, overlap other cuboids, or are collapsed.");
MGCAddSnippet(475, "Calculation of HTC values presented in results tables.");
MGCAddSnippet(476, "The values of Junction Temperature and Case Temperature that are reported in EDA Components results tables depend on the construction of the EDA Component.");
MGCAddSnippet(477, "Viewing, configuring, copying, and exporting results table data.");
MGCAddSnippet(478, "Tables are displayed in a pane within the Project Manager window, or in a dedicated window.");
MGCAddSnippet(479, "Using the extended Find to find results data in tables.");
MGCAddSnippet(480, "Displaying results data for each primitive (cuboid, prism, tet, or inverted tet) which forms part of a SmartPart.");
MGCAddSnippet(481, "For operations on the table data, such as data export and row hiding, selection of rows, columns, or cells is required.");
MGCAddSnippet(482, "You may need to resize a column width to show the title or data.");
MGCAddSnippet(483, "Tidy up large results tables by hiding unwanted columns.");
MGCAddSnippet(484, "Table sorting is not enabled by default.");
MGCAddSnippet(485, "Copying table cell data to the buffer for pasting.");
MGCAddSnippet(486, "You can save a set of results tables for re-display.");
MGCAddSnippet(487, "Creating a comma-separated text file containing results table data.");
MGCAddSnippet(488, "Legacy results tables are not available as tables in the product window, but their data can be exported in CSV files.");
MGCAddSnippet(489, "Use this dialog box to select which legacy results tables to export as CSV files.");
MGCAddSnippet(490, "Descriptions of each Results Table.");
MGCAddSnippet(491, "Results tables for selected model geometry, including assemblies, SmartParts, primitives, and monitor points. Data for each selected object is shown on a separate row or group of rows.");
MGCAddSnippet(492, "This table shows thermal values within the extent of the assembly.");
MGCAddSnippet(493, "The table displays the fluid flow data across the selected collapsed resistances.");
MGCAddSnippet(494, "This table shows temperature values for selected Compact Components.");
MGCAddSnippet(495, "This table shows heat values for selected Compact Components.");
MGCAddSnippet(496, "This table displays the data for selected Controllers.");
MGCAddSnippet(497, "This table displays the flow information for selected coolers. There is one row of information for each parent, followed by a row for each child extract and supply.");
MGCAddSnippet(498, "This table displays the fluid and heat flow information for the overall boundary and selected cutouts.");
MGCAddSnippet(499, "This table displays the values for volume, mass, and heat flow. There is one row for the domain, and one row for each cutout.");
MGCAddSnippet(500, "This table displays the power dissipation and maximum temperature for selected dies. If a die has a non-uniform heat dissipation, then additional rows are added for each die source.");
MGCAddSnippet(501, "This table displays the data for selected EDA boards.");
MGCAddSnippet(502, "This table displays the data for selected EDA components.");
MGCAddSnippet(503, "The table displays thermal details for selected EDA heat sinks.");
MGCAddSnippet(504, "This table displays the data for selected Enclosures.");
MGCAddSnippet(505, "This table displays the data for selected Fans.");
MGCAddSnippet(506, "This table displays data for selected Fixed Flows.");
MGCAddSnippet(507, "The table displays thermal data for selected heat pipes.");
MGCAddSnippet(508, "The table displays thermal details for selected heat sinks.");
MGCAddSnippet(509, "The Monitor Points table contains variables values for the end of a steady-state solution. In the case of transient solutions, the variables values shown are those for the selected Transient Time Step.");
MGCAddSnippet(510, "This table displays the details of selected network assemblies and their component network nodes.");
MGCAddSnippet(511, "The table displays thermal data for selected perforated plates.");
MGCAddSnippet(512, "The table displays the temperatures and applied power values.");
MGCAddSnippet(513, "This table displays the flow information for all selected racks. There is one row of information for each parent, followed by a row for each child extract and supply.");
MGCAddSnippet(514, "This table displays the flow information for selected recirculation devices. There is one row of information for each parent, followed by a row for each child extract and supply.");
MGCAddSnippet(515, "This table reports calculated mass and heat flow rates, presenting data for one face of a region per row.");
MGCAddSnippet(516, "This table presents the inward, outward, and net values for the volume, mass, and heat flow for each region, one row per region.");
MGCAddSnippet(517, "The table presents one region per row and reports the minimum, maximum, mean, standard deviation values for each calculated variable. Not applicable to plane regions.");
MGCAddSnippet(518, "The table displays the thermal information for the selected solid conductors in the project. There is one row for each surface that has heat transfer (not insulated).");
MGCAddSnippet(519, "The table displays the surface temperature and size for all selected solid conductors in the project that have heat transfer (that is, that are not insulated).");
MGCAddSnippet(520, "This table displays the total flux budget, that is, the proportion of heat leaving the entire solid conductor by convection, conduction, and radiation for selected solid conductors.");
MGCAddSnippet(521, "The table displays the power dissipation from all selected sources.");
MGCAddSnippet(522, "This table displays thermal data for selected TECs.");
MGCAddSnippet(523, "Legacy tables are only available in the format of CSV files.");
MGCAddSnippet(524, "A file, with the default name geometry_model.csv, containing data for all the modeling objects in the project.");
MGCAddSnippet(525, "The base grid files have default names baseGrid_axis-Grid_table.csv.There is a separate file for each direction (axis = X, Y, or Z). Each base grid file presents a single point in the grid per row for the selected direction. If there are objects with a localized grid, additional localized grid files are created, named localized object_axis-Grid_table.csv.");
MGCAddSnippet(526, "For transient solutions only. A file, with the default name time_grid_table.csv, containing the time-step grid points.");
MGCAddSnippet(527, "A file, with the default name object_attribute.csv, that lists the project geometry and any attached attributes.");
MGCAddSnippet(528, "In addition to the variables calculated during the solution, Simcenter Flotherm can calculate auxiliary variables after solution. These additional calculated variables are stored as part of the solution data.");
MGCAddSnippet(529, "Simcenter Flotherm derives auxiliary variables from the base variables (for example, temperature, pressure, and velocity) and standard derived variables (for example, speed, heat and mass flux, KE Turb, KE Diss).");
MGCAddSnippet(530, "The flow angle is used to evaluate the performance of a laminar (uni-directional) flow scheme.");
MGCAddSnippet(531, "The Total Pressure is important because the pressure associated with the velocity head (1/2 ρV2) can drive a current of air through against a pressure gradient, or when facing an obstruction can be converted to static pressure and therefore drive the flow.");
MGCAddSnippet(532, "Calculating additional auxiliary variables places additional burden on program memory.");
MGCAddSnippet(533, "Flow Angle is calculated as an additional auxiliary variable following a solve. Calculate the flow angle if it is important to determine whether the airflow is traveling in a specific direction.");
MGCAddSnippet(534, "Total Pressure is calculated as an additional auxiliary variable following a solve. Calculate the total pressure when you require pressure data that includes the pressure associated with the velocity head.");
MGCAddSnippet(535, "After calculating auxiliary variables, the results can be displayed in Analyze mode.");
MGCAddSnippet(536, "Use this dialog box to set the axis for the flow angle and confirm the additional variable calculation request.");
